import React from "react";
import KeepHeader from "./KeepHeader";
import KeepNote from "./KeepNote";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

const Keep = () => {

  let [dispData , newDispData] = useState([]);

  const btn = () => {
    alert("hello world");
  }

  return(
    <>
      <KeepHeader/>
      <KeepNote msg = {btn}/>
    </>
  );
}

export default Keep;
